import './App.css';

function App(){
  
    return(
        <div className="row">
            <User name="milad" >
                <div>میلاد</div></User>
            <User name='hasan' >
            <div>میلاد</div>
                </User>
            <User name="paras">
            <div>میلاد</div></User>
           
            

        </div>
    );
}
export default App;
